import {StyleSheet} from "react-native";


const style = StyleSheet.create({
    container: {
        flex: 1,
        padding: 24,
        backgroundColor: '#eaeaea',
    },
    buttonContainer: {
        backgroundColor: 'rgb(255,255,255,0)',
        display: "flex",
        flexWrap: "wrap",
        flexDirection: "row",
        marginLeft: '5%',
        marginRight: '5%',
    },
    title: {
        marginTop: 16,
        paddingVertical: 8,
        borderWidth: 4,
        borderColor: '#20232a',
        borderRadius: 6,
        backgroundColor: 'rgba(255,255,255,.1)',
        color: '#20232a',
        textAlign: 'center',
        fontSize: 30,
        fontWeight: 'bold',
    },
    button: {
        flex: 0.3,
        backgroundColor: '#57068c',
        marginTop: '5%',
        marginLeft: '5%',
        marginRight: '5%',
        textAlign: 'center',
        padding: 25,
    },
    // button: {
    //     backgroundColor: 'white',
    //     marginLeft: '5%',
    //     marginRight: '5%',
    //     padding: 25,
    //     borderRadius: 3,
    //     textAlign: "center",
    //     width: "40%",
    // }
});

export default style;
